import {QuestionCircleOutlined} from "@ant-design/icons";

export const columns = [
  {
    title: "orderer",
    key: "orderer",
    dataIndex: "orderer",
    ellipsis: false,
    sorter: true,
  },
  {
    title: "bread",
    key: "bread",
    dataIndex: "bread",
    ellipsis: false,
    sorter: true,
  },
  {
    title: "meat",
    key: "meat",
    dataIndex: "meat",
    ellipsis: false,
    sorter: true,
  },
  {
    title: "salad",
    key: "salad",
    dataIndex: "salad",
    ellipsis: false,
    sorter: true,
  },
  {
    title: "tomato",
    key: "tomato",
    dataIndex: "tomato",
    ellipsis: false,
    sorter: true,
  },
  {
    title: "onion",
    key: "onion",
    dataIndex: "onion",
    ellipsis: false,
    sorter: true,
  },
  {
    title: i18n.t<string>("categories.table.action"),
    key: "action",
    fixed: alignRight,
    className: "it-actions",
    onCell: () => {
      return {
        onClick: (e) =>
            e.stopPropagation(),
      };
    },
    render: (record) => (
        <TableButton
            icon={<DeleteOutlined />}
            buttonClassName="btn-danger"
        />
    ),
  },
];
